import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <h2>Home page</h2>
    </div>
  );
}

const About = () => {
  return (
    <div>
      <h1>About</h1>
      <h2>About page</h2>
    </div>
  );
}

const App = () => {
  return (
    <Router>
      <div>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
      </div>
      <Routes>
        <Route path="/" exact>
          <Home />
        </Route>

        <Route path="/about" exact>
          <About />
        </Route>
      </Routes>
    </Router>
    // <Home />
  );
}
export default App;
